import { makeStyles } from "@material-ui/core/styles";

export default makeStyles(() => ({
	intro: {
		textAlign: "center",
		display: "flex",
		justifyContent: "space-around",
	},
	image: {
		textAlign: "center",
		padding: "2rem 0",
	},
	about: {
		marginTop: "6rem",
	},
}));
